import { useState } from "react";
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import TableMUI from './cmpnts/TableMUI';
import AddData from './cmpnts/add_data';
import Ctfoot from './cmpnts/Ctfoot';
import Headers from './cmpnts/Headers';

function TabPanel({ children, value, index }) {
  return (
    <div hidden={value !== index}>
      {value === index && (
        <Typography component="div" style={{ padding: 8 }}>
          {children}
        </Typography>
      )}
    </div>
  );
}

function App() {
  const [value, setValue] = useState(0);
  const [showHiddenTab, setShowHiddenTab] = useState(false);
  const [searchQuery, setSearchQuery] = useState('');

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const handleButtonClick = () => {
    setShowHiddenTab(true);
    setValue(3);
  };

  const handleSearchChange = (event) => {
    setSearchQuery(event.target.value);
  };

  const handleSearchSubmit = (event) => {
    event.preventDefault();
    // Perform search logic with the searchQuery
    console.log("Search query:", searchQuery);
  };

  return (
    <div>
      <Headers />
      <div style={{ position: 'relative' }}>
        <Tabs value={value} onChange={handleChange}>
          <Tab label={`Home Page ${value === 0 ? (
            <form onSubmit={handleSearchSubmit} style={{ position: 'absolute', top: '-40px', right: '10px' }}>
              <input
                type="text"
                value={searchQuery}
                onChange={handleSearchChange}
                placeholder="Search..."
                style={{ padding: '5px' }}
              />
              <Button type="submit" variant="contained" color="primary" style={{ marginLeft: '10px' }}>
                Search
              </Button>
            </form>
          ) : null}`} />
          <Tab label={`Add Data ${value === 1 ? (
            <form onSubmit={handleSearchSubmit} style={{ position: 'absolute', top: '-40px', right: '10px' }}>
              <input
                type="text"
                value={searchQuery}
                onChange={handleSearchChange}
                placeholder="Search..."
                style={{ padding: '5px' }}
              />
              <Button type="submit" variant="contained" color="primary" style={{ marginLeft: '10px' }}>
                Search
              </Button>
            </form>
          ) : null}`} />
          {showHiddenTab ? (
            <Tab label={`Search Result ${value === 2 ? (
              <form onSubmit={handleSearchSubmit} style={{ position: 'absolute', top: '-40px', right: '10px' }}>
                <input
                  type="text"
                  value={searchQuery}
                  onChange={handleSearchChange}
                  placeholder="Search..."
                  style={{ padding: '5px' }}
                />
                <Button type="submit" variant="contained" color="primary" style={{ marginLeft: '10px' }}>
                  Search
                </Button>
              </form>
            ) : null}`} />
          ) : (
            <Button variant="contained" color="primary" onClick={handleButtonClick}>
              Show Hidden Tab
            </Button>
          )}
          <Tab label={`Analytics View ${value === 3 ? (
            <form onSubmit={handleSearchSubmit} style={{ position: 'absolute', top: '-40px', right: '10px' }}>
              <input
                type="text"
                value={searchQuery}
                onChange={handleSearchChange}
                placeholder="Search..."
                style={{ padding: '5px' }}
              />
              <Button type="submit" variant="contained" color="primary" style={{ marginLeft: '10px' }}>
                Search
              </Button>
            </form>
          ) : null}`} />
        </Tabs>
      </div>
      <div style={{ flexGrow: 1, backgroundColor: '#f5f5f5', height: '100vh' }}>
        <TabPanel value={value} index={0}>
          <TableMUI />
        </TabPanel>
        <TabPanel value={value} index={1}>
          <AddData />
        </TabPanel>
        <TabPanel value={value} index={2}>
          Analytics View Panel
        </TabPanel>
      </div>
      <Ctfoot />
    </div>
  );
}

export default App;
